import React from "react";

const Dashboard = () => {
  return (
    <div className="flex flex-col p-4">
      <div className="bg-white shadow-md rounded-lg p-6">
        <h2 className="text-lg font-medium mb-4">Dashboard</h2>
        <div className="flex flex-col">
          <div className="flex mb-4">
            <div className="w-1/3 text-gray-700 font-medium">Total Views</div>
            <div className="w-2/3 font-medium">5,000</div>
          </div>
          <div className="flex mb-4">
            <div className="w-1/3 text-gray-700 font-medium">Unique Visitors</div>
            <div className="w-2/3 font-medium">2,000</div>
          </div>
          <div className="flex mb-4">
            <div className="w-1/3 text-gray-700 font-medium">Bounce Rate</div>
            <div className="w-2/3 font-medium">40%</div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
